const treeData = {
  name: "Foreman",
  attributes: {
    department: "Assembly",
  },
  children: [
    {
      name: "Foreman",
      attributes: {
        department: "Assembly",
      },
      children: [
        {
          name: "Foreman",
          attributes: {
            department: "Assembly",
          },
          children: [
            {
              name: "Foreman",
              attributes: {
                department: "Assembly",
              },
              children: [
                {
                  name: "Foreman",
                  attributes: {
                    department: "Assembly",
                  },
                  children: [
                    {
                      name: "Foreman",
                      attributes: {
                        department: "Assembly",
                      },
                      children: [
                        {
                          name: "Foreman",
                          attributes: {
                            department: "Assembly",
                          },
                          children: [
                            {
                              name: "Foreman",
                              attributes: {
                                department: "Assembly",
                              },
                              children: [
                                {
                                  name: "Worker",
                                },
                              ],
                            },
                          ],
                        },
                      ],
                    },
                  ],
                },
              ],
            },
          ],
        },
      ],
    },
  ],
};

export default treeData;
